import { connect } from "react-redux";
import React from 'react';


const City = () => {

    const city = this.props;

    return (
        <div>
            <h3>{city.name}</h3>
            <h3>{city.temp}</h3>
        </div>
    );
};


const CityList = () => {

    const dataCity = this.props.dataCity;

    const cityList = dataCity.map(function (city) {
        return <City dataCity = {city} />
    });

    return cityList;

};

const mapStateToProps = (state) => ({
    dataCity: state.city
});

export default connect(mapStateToProps)(CityList);
